module.exports = "<!--about us header-->\r\n<div class=\"mainSeperator\">\r\n  <div style=\"width: 100%; height: 20px; border-bottom: 1.5px solid #BFC0C1; text-align: center\">\r\n    <span style=\"color:#00A3F3; font-size: 28px; background-color: #ffffff; padding: 0 10px;\">\r\n      About Us\r\n    </span>\r\n  </div>\r\n</div>\r\n<!--purpose-->\r\n<div class=\"sep\">\r\n  <div class=\"container\">\r\n    <div class=\"row\">\r\n      <div class=\"col\">\r\n        <h3>Purpose</h3>\r\n        The purpose of our team, is the development of the first autonomous, electric, formula-style race car in Greece,\r\n        in\r\n        order to participate in the «Formula Student Driverless» competitions.\r\n      </div>\r\n    </div>\r\n  </div>\r\n</div>\r\n<!--out team-->\r\n<div class=\"sep\">\r\n  <div class=\"container\">\r\n    <div class=\"row\">\r\n      <div class=\"col\">\r\n        <h3>Our Team</h3>\r\n        The first Greek student team, that has been created for the above purpose, consists of young people, that are full\r\n        of\r\n        passion, willing to help, have lots of imagination and craziness as well. In this difficult attempt, we do not\r\n        only need\r\n        people with abilities and knowledge. Necessary elements of this team, are the correct organization and excellent\r\n        cooperation, among its members.\r\n      </div>\r\n    </div>\r\n  </div>\r\n</div>\r\n<!--our name-->\r\n<div class=\"sep\">\r\n  <div class=\"container\">\r\n    <div class=\"row\">\r\n      <div class=\"col\">\r\n        <h3>Mythology</h3>\r\n        According to Greek mythology, Phineus was blinded by Zeus, who sent him the Harpies, in order for them to take his\r\n        food\r\n        away and keep him always hungry. His liberators, were the Argonauts, to whom Phineus revealed how to get to their\r\n        destination and how to pass the Symplegades safely, the huge rocks, which constantly clashed together, so that no\r\n        ship\r\n        could go through.\r\n      </div>\r\n    </div>\r\n  </div>\r\n</div>\r\n<!--formula student driverless competition-->\r\n<div class=\"sep\">\r\n  <div class=\"container\">\r\n    <div class=\"row\">\r\n      <div class=\"col\">\r\n        <h3>Formula Student Driverless Competition</h3>\r\n        Formula SAE is one of the biggest student competitions worldwide. It started in 1980 by the SAE student branch at\r\n        the\r\n        University of Texas. Over the years, the competition evolved. In 2010, the category of electrical vehicles was\r\n        added and\r\n        in 2017 the category of driverless vehicles.\r\n        <hr>\r\n        The aim of the competition is for students to cooperate with each other, to present innovative ideas, to design,\r\n        construct, develop and finally to compete with small, autonomous, formula-style racing cars.\r\n        <hr>\r\n        The competition consists of 2 main categories of events. Static events and Dynamic events, with total score of\r\n        1000\r\n        points.\r\n      </div>\r\n    </div>\r\n  </div>\r\n</div>\r\n<!--tables-->\r\n<div class=\"container\">\r\n  <div class=\"row\">\r\n    <div class=\"col\">\r\n      <h3>Dynamic Events</h3>\r\n      <table class=\"table\">\r\n        <tbody>\r\n          <tr>\r\n            <td>Skidpad</td>\r\n            <td>75 points</td>\r\n          </tr>\r\n          <tr>\r\n            <td>Acceleration</td>\r\n            <td>75 points</td>\r\n          </tr>\r\n          <tr>\r\n            <td>Efficiency</td>\r\n            <td>100 points</td>\r\n          </tr>\r\n          <tr>\r\n            <td>Trackdrive</td>\r\n            <td>250 points</td>\r\n          </tr>\r\n        </tbody>\r\n      </table>\r\n    </div>\r\n    <div class=\"col\">\r\n    <h3>Static Events</h3>\r\n    <table class=\"table\">\r\n      <tbody>\r\n        <tr>\r\n          <td>Business Plan</td>\r\n          <td>75 points</td>\r\n        </tr>\r\n        <tr>\r\n          <td>Cost</td>\r\n          <td>100 points</td>\r\n        </tr>\r\n        <tr>\r\n          <td>Efficiency</td>\r\n          <td>100 points</td>\r\n        </tr>\r\n        <tr>\r\n          <td>Engineering Design</td>\r\n          <td>150 points</td>\r\n        </tr>\r\n        <tr>\r\n          <td>Autonomous Design</td>\r\n          <td>175 points</td>\r\n        </tr>\r\n      </tbody>\r\n    </table>\r\n    </div>\r\n  </div>\r\n</div>\r\n<!--Footer-->\r\n<div class=\"fooT\">\r\n  <footer class=\"page-footer font-small special-color-dark pt-4\">\r\n   <div class=\"container\">\r\n     <div class=\"row\">\r\n       <div class=\"col\">\r\n         <div id=\"ls\">\r\n            <h4>Let's Socialize</h4>\r\n            <a href=\"https://www.facebook.com/fineasracingteam/\"><img src=\"../../../assets/facebook.png\" alt=\"\"></a>\r\n            <a href=\"https://www.instagram.com/fineasracingteam/\"><img src=\"../../../assets/instagram.png\" alt=\"\"></a>\r\n           <a href=\"https://twitter.com/FineasTeam\"><img src=\"../../../assets/twitter.png\" alt=\"\"></a>\r\n           <a href=\"https://www.youtube.com/channel/UCH1xQQtQrYpK0FpqMOvvNwg/featured\"><img src=\"../../../assets/youtube.png\" alt=\"\"></a>\r\n          </div>\r\n       </div>\r\n       <div class=\"col\">\r\n        <h4>Say Hi</h4>\r\n        hi@fineasracingteam.gr\r\n       </div>\r\n       <div class=\"col\" style=\"background:black\">\r\n       </div>\r\n       </div>\r\n       <div id=\"cpr\">\r\n         Copyrights © 2019 Fineas Racing Team. All Rights Reserved\r\n       </div>\r\n     </div>\r\n  </footer>\r\n</div>"

